function Intro() {
  return (
    <div
      className="col-12 ms-2 "
      style={{
        height: "300px",
        boxShadow: "0px 0px 15px -2px 	#B0B0B0",
        borderRadius: "15px",
      }}
    >
           <div className="row">
                 <div className="col-3">
                 <img
                style={{
                  marginTop:"20px",
                  marginLeft:"20px",
                  color: "white",
                  background: "#707070",
                  borderRadius: "50%",
                  border: "2px solid #404040 ",
                  maxWidth: "230px",
                  maxHeight: "230px",
                }}
                alt=""
                src="images/profile.jpg"
              />
                 </div>
                 <div className="col-5" style={{ paddingTop:"20px"}}>
                       <h3>Malek Guedda</h3>
                       <div>La psychologie est la connaissance empirique ou intuitive des sentiments, des idées, des comportements d'une personne et des manières de penser, de sentir, d'agir qui caractérisent un individu ou un groupe.</div>
                 </div>
                 <div className="col-4">
                       Citation
                 </div>
           </div>
    </div>
  );
}
export default Intro;
